int GetRow4tIndex(int64_t v) {// lookup on row4t

	register int64_t R4 = row4tdich[7], V = v, rcomp = V - R4;
	register int step=512,imiddle;
	if (V < 214365897) return -1; // first entry
	if (!rcomp) return 8192; // middle for the dichotomy
	if (rcomp > 0) {
		R4 = row4tdich[9]; rcomp = V - R4;
		if (!rcomp) return 10240;
		if (rcomp > 0) {// sequentiel lookup at the end
			for (int i = 10241; i < 10375; i++) {
				rcomp = V - row4t[i]; if (!rcomp) return i;
				if (rcomp < 0)return -1;// not a valid row 4
			}
			return -1; // not a valid row 4
		}
		else {
			R4 = row4tdich[8]; rcomp = V - R4;		if (!rcomp) return 9216;
			if (rcomp > 0)imiddle = 9216 + step; else imiddle = 9216 - step;
		}
	}
	else {// first steps of a dichotomy to reach a step of 1024
		R4 = row4tdich[3]; rcomp = V - R4;
		if (!rcomp) return 4096; 
		if (rcomp > 0) {
			R4 = row4tdich[5]; rcomp = V - R4;		if (!rcomp) return 6144;
			if (rcomp > 0) {
				R4 = row4tdich[6]; rcomp = V - R4;	if (!rcomp) return 7168;
				if (rcomp > 0)imiddle = 7168 + step;else imiddle = 7168 - step;
			}
			else {
				R4 = row4tdich[4]; rcomp = V - R4;	if (!rcomp) return 5120;
				if (rcomp > 0)imiddle = 5120 + step; else imiddle = 5120 - step;
			}
		}
		else {
			R4 = row4tdich[1]; rcomp = V - R4;		if (!rcomp) return 2048;
			if (rcomp > 0) {
				R4 = row4tdich[2]; rcomp = V - R4;	if (!rcomp) return 3072;
				if (rcomp > 0)imiddle = 3072 + step; else imiddle = 3072 - step;
			}
			else {
				R4 = row4tdich[0]; rcomp = V - R4;	if (!rcomp) return 1024;
				if (rcomp > 0)imiddle = 1024 + step; else imiddle = 1024 - step;
			}

		}
	}
	// now a bloc of 1024 to lookup (pointer to the midle in imiddle)
	//cout << v << " enter dicho " << imiddle << " " << step << endl;
	int last = imiddle + step - 1;
	while (1) {
		R4 = row4t[imiddle-1]; rcomp = V - R4;	if (!rcomp) return imiddle-1;
		if (!(step >>= 1)) {
			if (imiddle == last) {// not reached here
				R4 = row4t[imiddle]; rcomp = V - R4;	if (!rcomp) return imiddle;
			}
			return -1;
		}
		if (rcomp > 0)imiddle +=  step; else imiddle -=  step;
		//cout <<"loop "<<  imiddle << " " << step << endl;
	}
}
